import React, { Component } from "react";
import {
  Container,
  Navbar,
  NavbarBrand,
  Row,
  Col,
  Nav,
  NavItem,
  NavLink
} from "reactstrap";
class LeftNav extends Component {
  state = {};
  render() {
    return (
      <Navbar>
        <Nav vertical>
          <NavItem>
            <NavLink href="#">Link</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#">Link</NavLink>
          </NavItem>
          <NavItem>
            <NavLink href="#">Link</NavLink>
          </NavItem>
        </Nav>
      </Navbar>
    );
  }
}

export default LeftNav;
